import React, { Component } from 'react';
import { HashRouter as Router, Route, Link, NavLink } from 'react-router-dom';
import SignUpForm from './pages/SignUpForm';
import SignInForm from './pages/SignInForm';
import Navbar from "./pages/navbar";

import ComponentSection from "./componentSection";
import './section.css'


import './App.css';

class Header extends Component{
  render() {
      return(
          <header>
              <Navbar/>
          </header>
      )
  }
} 

class Section extends Component{
  handleClick;

  render() {

      this.handleClick = () => {
          console.log('OUI')
      };

      return(
          <section>
              <ComponentSection title="Titre 1" content="Contenu 1" button="ok"/>
              <ComponentSection title="Titre 2" content="Contenu 2"/>
              <ComponentSection onClick={this.handleClick} title="Titre 3" content="Contenu 3" button="ok"/>
          </section>
      )
  }
}



class App extends Component {
  render() {
    return (
      <Router basename="/nemesia/">
        <div className="App">

          <div className="App__Form">
            <div className="PageSwitcher">
                <NavLink to="/sign-in" activeClassName="PageSwitcher__Item--Active" className="PageSwitcher__Item">Se connecter</NavLink>
                <NavLink exact to="/" activeClassName="PageSwitcher__Item--Active" className="PageSwitcher__Item">Inscription</NavLink>
              </div>



              <Route exact path="/" component={SignUpForm}>
              </Route>
              <Route path="/sign-in" component={SignInForm}>
              </Route>
          </div>

        </div>
      </Router>
    );
  }
}

export default App;
